import { css } from "@emotion/core";
import styled from "@emotion/styled";
import { TableRow } from "@material-ui/core";
import TableCell from "@material-ui/core/TableCell";
import TableHeadComponent from "@material-ui/core/TableHead";
import Typography from "@material-ui/core/Typography";
import React from "react";

const StyledCell = styled(({ width }) => TableCell)`
    width: ${width ? width : "auto"};
`;

const text = css`
    font-weight: 500;
`;

const TableHead: React.FC = (): JSX.Element => {
    const renderCell = (value: string, width?: number) => (
        <StyledCell css={cell(width)}>
            <Typography css={text} variant="subtitle1" component="p">
                {value}
            </Typography>
        </StyledCell>
    );

    return (
        <TableHeadComponent>
            <TableRow>
                {renderCell("ID")}
                {renderCell("Name")}
                {renderCell("Surname")}
                {renderCell("Date of birth")}
                {renderCell("Position")}
                {renderCell("Phone number")}
                {renderCell("Actions", 200)}
            </TableRow>
        </TableHeadComponent>
    );
};

export default TableHead;
